import React, {Component} from 'react';
import '../scss/menu.scss';
import {MenuItem} from '../AddComponents/MenuItem';

class Menu extends Component {
    render() {
        return (
            <div className='menu'>
                <nav className='NavbarItems'>
                    <h4 className='logo'> Menu </h4>
                    <div className='MenuIcon'>

                    </div>
                    <ul>
                        <li><a href=''></a></li>
                    </ul>
                </nav>
            </div>
        );
    }
}

export default Menu;
